data:
{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

التاريخ
تشكلت برلين من اندماج مستوطنتين هما (Cölln)، التي تقع حالياً في جزيرة المتاحف (Museums Island)، وبرلين التي تقع على الضفة الشمالية لنهر شبريه (Spree)، واللتان يعود تشكلهما إلى القرن الثالث عشر الميلادي'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

برلين مقر الإقامة الملكية
في عام 1701م، وعقب تتويج عضو المجلس الانتخابي الأمير فريدريش الثالث بصفته الملك فريدريش الأول لبروسيا، تم تخفيف الحالة التي كانت عليها مدينة برلين، وقد أصبحت مقراً للإقامة الملكية وعاصمة للدولة، وشهدت خلال هذه الفترة بناء العديد من المباني الفخمة'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

عاصمة الإمبراطورية الألمانية
بلغ تعداد سكان برلين 800'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

إعادة البناء والتقسيم
بعد انتهاء الحرب العالمية الثانية، قسمت برلين إلى أربعة قطاعات'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

انهيار جدار برلين وعملية إعادة التوحيد
في ليلة التاسع من نوفمبر عام 1989م، تم هدم جدار برلين على نحو غير متوقع بعد عدة أشهر من تسلل مواطني الجمهورية الألمانية الديمقراطية إلى الغرب عبر المجر والاتحاد السوفييتي'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

علم أصول الكلمات
أصل اسم برلين غير مؤكد'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

الجغرافيا
تقع برلين إلى الشرق من ألمانيا في وسط أوروبا على بعد حوالي 70 كم غربي الحدود مع بولندا'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

التضاريس
تشكّل وادي برلين - وارسو أورسترومتال (بالألمانية: Berlin–Warschau Urstromtal) من الماء المتدفق نتيجة ذوبان الصفائح الجليدية في نهاية العصر الجليدي'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

المناخ
وفقاً لتصنيف كوبن للمناخ (بالألمانية: Köppen)، تعد برلين من المناطق ذات الحرارة المعتدلة'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

التقسيمات الإدارية في برلين
تتكون برلين من 12 منطقة ويوجد فيها 97 رمزاً بريدياً (2020)'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

السكان
بلغ عدد سكان برلين 3,664,088 وفقاً لإحصائيات عام 2020'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

لغة
قد تأثرت لهجة برلين بالمسيحيين الفرنسيين في القرن السابع عشر فتبنت الكثير من الكلمات من الأصل الفرنسي مثل: "Budike" (حانة أو دكان)، "Boulette" (اللحم)، «ملفوفة» (شرائح اللحم الملفوفة) و"Destille" (حانة)'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

العاصمة
برلين هي عاصمة جمهورية ألمانيا الاتحادي'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

شرطة
شرطة برلين (Polizei Berlin) هي قوة شرطة الولاية الألمانية لدولة مدينة برلين'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

الاقتصاد والبنية التحتية
الناتج الإجمالي لبرلين بلغ 163 مليار يورو عام 2021'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

السياحة
فهناك خيارات واسعة تقدمها المدينة لزوارها من الفنادق الأشهر على مستوى العالم'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

تجارة
تنفرد برلين بوجود العديد من أماكن التسوق، بدءاً من شوارع التسوق الحضرية ذات الأجواء التقليدية القديمة وانتهاءً بالمراكز التجارية وشوارع التسوق الحديثة، كلٌ يمثل عالماً متميزاً له طابعه الخاص، إلا أن السمة المشتركة في هذه المراكز التجارية تتمثل في المزج بين المتاجر، والبوتيكات، والمطاعم، والمقاهي'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

حركة النقل
تنوعت حركة النقل في برلين بريا وجويا في المناطق الحضارية، فيوجد 979 جسر عبر197 كيلومترا من الطرق المائية الداخلية، و5334 كيلومتر (3314 ميل) من الطرق التي تشغل برلين ومنها 73 كيلومترا (45 ميلا) من الطرق السريعة'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

الرعاية الصحية في برلين
تمتلك برلين تاريخاً عريقاُ كمدينة للطب والتكنولوجيا الطبية'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

الفن والموسيقى في برلين
ثماني أوركسترات سمفونية منها اوركسترا برلينير فيلهارموني (بالألمانية: Berliner Philharmonie) الشهيرة وبيت الأوبرا العظيم معاً يشكلان حياة برلين الموسيقية'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

مناسبات واحتفالات برلين
برلين مدينة لا تعرف النوم تقدم على مدار السنة العروض والنشاطات لجميع الأذواق، كما تضم الكثير من الحانات والحفلات الموسيقية'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

متاحف برلين
برلين هي مدينة المتاحف حيث تستضيف كنوز الحضارات من جميع أنحاء العالم وأعمال لعظماء من الماضي والحاضر'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

المطبخ
الخيارات المتنوعة للطعام والشراب في برلين ليس لها نهاية'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

النشاطات الترفيهية
تقدم برلين الكثير من الألعاب الشبابية كالدراجات وسباق السيارات الصغيرة الكارتنج ورحلات السفاري بالسيارات'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

الرياضة
حققت برلين سمعة واسعة في مجال الرياضة العالمية، فقد ضمت الأولمبيات في عام 1936م وكانت البلد المضيف لنهائي كأس العالم لكرة القدم عام 2006م'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

الألعاب المائية
تقع في برلين مدينة مائية وحديقة استوائية داخلية كبيرة تسمى تروبيكال أيلاندس (Tropical Islands) حيث يمكن للزوار الاستمتاع بالأجواء الاستوائية وأشجار النخيل على شواطئ الرمل'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

الحياة الليلية
تتميز الحياة الليلية في برلين بمزج بين أنواع الموسيقى المختلفة، وتجمع في نفس الوقت بين مختلف الأعراق والأجناس'}

{'pageTitle': 'برلين#:~:text=بلغ%20عدد%20سكان%20برلين%203%2C664%2C088', 'language': 'ar', 'text': '

بعض الحقائق المميزة لبرلين
تبلغ مساحة برلين 892 كيلومتر مربع، وهي تعادل مساحة العاصمة الفرنسية تسع مرات'}
